import React from 'react';
import './header.scss';

const Header = () => {
    return (
        <div className="header container">
            <nav className="row">
                <div className="col-12">
                    <a className="navbar-brand" href="#">
                        <div className="logo"><strong> [ </strong>Smart<strong>Code ]</strong></div>
                    </a>
                </div>
                <div className="col-12 links">
                    <button className="btn btn-dark">&#9776; Menu</button>
                </div>                
            </nav>
        </div>
    )
}

export default Header;
